    [],nt"revision_timestamp": "2016-07-27T22:24:58.546977",nt"name": "regional-economic-effects-of-current-and-proposed-management-alternatives-for-sand-lake-na",nt"isopen":
    false,nt"url": null,nt"notes": "This report first provides a description
    of the local community and economy near Sand Lake NWR. An analysis of current and
    proposed management strategies that could affect the local economy is then presented.
    The Refuge management activities of economic concern in this analysis are Refuge
    personnel staffing and Refuge spending within the local community, and spending
    in the local community by Refuge visitors. The purpose of this study was to provide
    the economic analysis needed for the Sand Lake NWR Comprehensive Conservation Plan
    (CCP) by evaluating the regional economic impacts associated with the Sand Lake
    NWR Draft CCP management strategies.",nt"license_title": "License Not Specified",nt"extras":
